function qp(k){return new URL(location).searchParams.get(k)||"";}
const name=decodeURIComponent(qp("name")||"Employee Name");
const empID=qp("id")||"000001";
const certNo="TWCFS"+("000000"+empID).slice(-6);
const date=new Date().toLocaleDateString("en-GB").replace(/\//g,"/");
document.getElementById("btn").onclick=()=>{
 const cv=document.getElementById('c'),ctx=cv.getContext('2d'),img=new Image();img.src=bg;
 img.onload=()=>{
  ctx.drawImage(img,0,0,cv.width,cv.height);
  ctx.fillStyle="#000";
  ctx.font="bold 28px Arial";ctx.textAlign="center";ctx.fillText(name,cv.width/2,360);
  ctx.font="bold 22px Arial";ctx.textAlign="left";ctx.fillText(date,135,562);
  ctx.textAlign="center";ctx.fillText(empID,cv.width/2,562);
  ctx.textAlign="right";ctx.fillText(certNo,985,562);
  const {jsPDF}=window.jspdf;
  const pdf=new jsPDF({orientation:"landscape",unit:"px",format:[cv.width,cv.height]});
  pdf.addImage(cv.toDataURL("image/png"),"PNG",0,0,cv.width,cv.height);
  const blob=pdf.output('blob');const url=URL.createObjectURL(blob);
  document.body.innerHTML=`<iframe src='${url}' style='width:100%;height:80%;border:none'></iframe>
    <a href='${url}' download='${name.replace(/\s+/g,"_")}_Certificate.pdf'
       style='margin-top:16px;padding:12px 24px;background:#1f4e79;color:#fff;text-decoration:none;border-radius:6px;font-family:Arial'>
       Tap here to download PDF</a>`;
 };
};
</script>
